import React from 'react';
import { useSelector } from 'react-redux';
import { FooterWrapper } from '../../styles/components/FooterStyle';

export const Footer = () => {
    const isDark = useSelector(state => state.dark.mode);
    return (
        <FooterWrapper isDark={isDark}>
            <div>
                <div>Created By :</div>
                <div>Rakshith Acharya</div>
            </div>
            <div>
                <div>
                    <div><span>Contact No.</span><span> : </span><span>+91-7019892499</span></div>
                    <div><span>Email</span><span> : </span><span>rakshith</span></div>
                </div>
                <div></div>
            </div>
        </FooterWrapper>
    )
}
